  \"supawna-meadows-national-wildlife-refuge-annual-narrative-report-calendar-year-1995\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Supawna
  Meadows NWR outlines Refuge accomplishments during the 1995 calendar year. The report
  begins with a summary of the year's highlights and weather conditions. Land acquisition
  is covered. The report includes a planning section which discusses the master plan,
  management planning, compliance with environmental and cultural resource mandates,
  and research and investigations. Refuge administration is outlined; information
  about personnel, volunteer programs, funding, safety, and technical assistance is
  given. Habitat management is also covered; subjects include wetlands, forests, croplands,
  and pest control. The wildlife section of the report discusses endangered and threatened
  species, waterfowl, marsh birds and waterbirds, shorebirds, raptors, game mammals,
  and fisheries resources. The public uses of the Refuge described in this report
  include interpretive programs, hunting, trapping, wildlife observation, and law
  enforcement. The equipment and facilities section of the report provides information
  about rehabilitation, major maintenance, equipment replacement, communication systems,
  and computer systems. Cooperative programs are provided at the end. Refuge brochures
  and field guides are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
